g.script:
const introVideo = document.querySelector('#intro-video');
const introBtn = document.querySelector('#intro-btn');
const apiBtn = document.querySelector('#api-btn');
const apiSVG = document.querySelector('#api');
const browserSVG = document.querySelector('#browser');
const pageLoadingIcon = document.querySelector('.page-loading__icon');

var pausedLastFrame = false;

// Hide loading div when video is playing

function hideLoading() {
	pageLoadingIcon.classList.add('display-none');
}

introVideo.addEventListener('playing', hideLoading);

// Show loading div when video is waiting

function showLoading() {
	pageLoadingIcon.classList.remove('display-none');
}

introVideo.addEventListener('waiting', showLoading);

// Pause/Unpause the video on tab out and in

var hidden, visibilityChange;
if (typeof document.hidden !== "undefined") { // Opera 12.10 and Firefox 18 and later support
  hidden = "hidden";
  visibilityChange = "visibilitychange";
} else if (typeof document.msHidden !== "undefined") {
  hidden = "msHidden";
  visibilityChange = "msvisibilitychange";
} else if (typeof document.webkitHidden !== "undefined") {
  hidden = "webkitHidden";
  visibilityChange = "webkitvisibilitychange";
}

var handleVisibilityChange = function() {
  if (document[hidden]) {
    introVideo.pause();
  } else {
    introVideo.play();
  }
};

if (hidden !== undefined) {
  document.addEventListener(visibilityChange, handleVisibilityChange);
}

// Pause video just before it finishes

var pauseLastFrame = function() {
  if (introVideo.currentTime > introVideo.duration - 0.2) {
    introVideo.pause();
    pausedLastFrame = true;
    if (hidden !== undefined) {
      document.removeEventListener(visibilityChange, handleVisibilityChange);
    }
    introVideo.removeEventListener('timeupdate', pauseLastFrame);
    introVideo.removeEventListener('playing', hideLoading);
    introVideo.removeEventListener('waiting', showLoading);
  }
};
introVideo.addEventListener('timeupdate', pauseLastFrame);

// Navigation

var canClick = true;
var lastClicked = 'intro';

var apiBtnClickFunc = function() {
	if (!canClick) return;
	if (lastClicked === 'api') return;

	canClick = false;
	lastClicked = 'api';

  if (!pausedLastFrame) introVideo.pause();

  apiBtn.style.color = 'hsl(0, 0%, 50%)';
  introBtn.style.color = 'hsl(0, 0%, 66%)';

  browserSVG.addEventListener('transitionend', function() {
    canClick = true;
    browserSVG.classList.add('display-none');

    apiSVG.classList.remove('display-none');
    apiSVG.style.opacity = '1';
  }, {'once': 'true'});

  browserSVG.style.opacity = '0';
};

apiBtn.addEventListener('click', apiBtnClickFunc);

var introBtnClickFunc = function() {
	if (!canClick) return;
	if (lastClicked === 'intro') return;

	canClick = false;
	lastClicked = 'intro';

  if (!pausedLastFrame) introVideo.play();

  apiBtn.style.color = 'hsl(0, 0%, 66%)';
  introBtn.style.color = 'hsl(0, 0%, 50%)';

  apiSVG.addEventListener('transitionend', function() {
    canClick = true;
    apiSVG.classList.add('display-none');

    browserSVG.classList.remove('display-none');
    browserSVG.style.opacity = '1';
  }, {'once': 'true'});

  apiSVG.style.opacity = '0';
};

introBtn.addEventListener('click', introBtnClickFunc);
